import {connect} from "react-redux";
import {Field, reduxForm} from "redux-form";
import {required} from "../../Validators/validator"
import s from "./CheckoutStyle/Checkout.module.css";


const ChekoutForm = (props) => {


    return (
        <form className={s.form_login}>
            <div>
                <Field className={s.inputform} component={"input"} placeholder={"Login"} name={"email"}
                       validate={[required]}/>
            </div>

            <div className={s.password}>
                <Field className={s.inputform_password} component={"input"} placeholder={"Password"}
                       name={"password"}
                       validate={required}/>


            </div>


            <div className={s.check}>

                <Field type={"checkbox"} name={"rememberme"} className={s.checkbox}/>
                <span>remember me</span>
            </div>


            <div>
                <button className={s.button}>Login</button>
            </div>
        </form>
    )
}


const ReduxChekoutForm = reduxForm({
    form: 'order'

})
(ChekoutForm)


const Checkout = (props) => {


    return (
        <div className={s.content}>
            <div className={s.login_block}>
                <h1>Login</h1>
                <ReduxChekoutForm/>
            </div>

        </div>
    )

}


const mapStateToProps = (state) => ({})
export default connect(mapStateToProps, {})(Checkout)
